import React from "react";
import { css } from "@emotion/core";
import { COLORS } from "../../constants";
const SideNavLinks = () => {
  return (
    <React.Fragment>
      <ul
        css={css`
          height: calc(100% - (20px + 30px));
          display: block;
        `}
      >
        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
