        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
        <li>Dashboard</li>
      </ul>
    </React.Fragment>
  );
};

export default SideNavLinks;
